    false,nt"url": null,nt"notes": "This CTD data set, consisting of 47 casts,
    was collected in the Chukchi Sea during the F/V Alaskan Enterprise (AE10-01) cruise,
    August 24 - September 20, 2010 (cruise ID, CHAOZ 2010). The cruise was funded by
    DOI Bureau of Ocean Energy Management (BOEM) through the NOAA National Marine Mammal
    Laboratory. Involved groups included NMML, AFSC, BOEM, PMEL and EcoFOCI.nnCTD operations
    on this cruise were managed by EcoFOCI personnel from NOAA/PMEL. Due to a winch
    failure, CTD operations were limited. A Seabird SBE-911plus was deployed by hand,
    bottles were tripped using messengers, and limited measurements were made. Profile
    data from CTD instruments were processed at NOAA/PMEL/EcoFOCI using standard techniques.
    Data files are averaged to a 1-meter grid.",nt"license_title": null,nt"extras":
